import React  from 'react'
import Gif from './Gif'
export default function ListOfGifs({gifs}){

  { 
    /* Hacemos un mapeo para renderizar una imagen haces un mapeo del array*/ 
    return gifs.map(({id, title, url}) =>
       <Gif 
       key={id} title ={title}  url={url} id={id}/>
     )
   }

}
